import React from 'react';
import Header from './components/Header';
import Search from './components/Search';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">

        <Switch>
          <Route path="/search">
            {<p>검색결과</p>}
          </Route>
          <Route path="/">
            {<Header />}
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
